import { useState,useEffect } from "react";
import {  useParams } from "react-router-dom";



function Cart(){


    const[data,setData]=useState("")

    const {empid}=useParams()
 
    useEffect(()=>{
      fetch("http://localhost:3006/learn/"+empid)
      .then((jos)=>{
         return jos.json()
      })
      .then((das)=>{
          setData(das.data)
         
      }) 

  },[])
 

    const submitOn=((e)=>{
        e.preventDefault()
        
        fetch("http://localhost:3006/learn/"+empid,{
            method:"PUT",
            headers:{"content-type":"application/json"},
            body:JSON.stringify(data)
        })
       
    })



    return(
        <div>
            <div>
            {data.map((one) => (
                <ul style={{ listStyle: "none" }}>
                  <div id="b">
                    <img
                      src={one.img}
                      style={{
                        width: "200px",
                        height: "200px",
                        marginLeft: "8px",
                      }}
                    ></img>
                    <li>
                      <span style={{ fontSize: "18px", marginLeft: "35px" }}>
                        Brand :{" "}
                      </span>
                      {one.brand}{" "}
                    </li>
                    <li style={{ marginLeft: "35px" }}>{one.collection}</li>
                    <li>
                      <span style={{ fontSize: "18px", marginLeft: "35px" }}>
                        Model :{" "}
                      </span>
                      {one.model}
                    </li>
                    <li style={{ marginLeft: "35px" }}>{one.reference}</li>
                    <li style={{ marginLeft: "35px" }}>{one.complement}</li>
                    <li>
                      <span style={{ fontSize: "18px", marginLeft: "35px" }}>
                        Year :{" "}
                      </span>
                      {one.year}
                    </li>
                    <li>
                      <span style={{ fontSize: "18px", marginLeft: "35px" }}>
                        Price :{" "}
                      </span>
                      {one.price}{" "}
                      <a style={{ color: "blue", fontSize: "20px" }}>$</a>
                    </li>
                    <button id="a" className="btn btn-success" onClick={submitOn} >
                      Add Cart
                    </button>
                  </div>
                </ul>
              ))}

            <Link to="/control" className="btn btn-danger">
                 Back
            </Link>
            </div>
            
        </div>
    )
}

export default Cart;
